CREATE TABLE IF NOT EXISTS "crafting_logs" (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`class`	TEXT,
	`level`	INTEGER,
	`name`	TEXT,
	`requires`	TEXT,
	`ingredients`	TEXT,
	`icon`	TEXT,
	`done`	INTEGER DEFAULT 0,
