CREATE TABLE IF NOT EXISTS "hunting_logs" (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`class`	TEXT,
	`set`	TEXT,
	`rank`	INTEGER NOT NULL,
	`region`	TEXT NOT NULL,
	`area`	TEXT NOT NULL,
	`enemy`	TEXT NOT NULL,
	`num`	INTEGER NOT NULL,
	`x_loc`	INTEGER NOT NULL,
	`y_loc`	INTEGER NOT NULL,
	`icon`	TEXT,
	`done`	INTEGER DEFAULT 0,
	UNIQUE(_id)
);
CREATE UNIQUE INDEX IF NOT EXISTS _uid ON hunting_logs (_id);
